fields = ['GUI',
          'NE_UID',
          'POLYGON',
          'ORIG_HAB',
          'ORIG_CLASS',
          'Eunis_L3',
          'HAB_TYPE',
          'VERSION',
          'DET_MTHD',
          'DET_NAME',
          'TRAN_COM',
          'T_RELATE',
          'VAL_COMM',
          'Three_Step',
          'MESH_Confi',
          'geometry']


def add_fields(x):
    """ To check that field are present and insert them if not"""
    field_name_list = x.columns.tolist()
    for fieldToAdd in fields:
        if fieldToAdd not in field_name_list:
            x[fieldToAdd] = None


def split_mosaic(x):
    """function which splits mosaic codes into individual habitats codes """
    surveyCodeQuery = x.drop('HAB_TYPE', axis=1) \
        .join(x['HAB_TYPE']
              .str
              .split('+', expand=True)
              .stack()
              .reset_index(level=1, drop=True).rename('HAB_TYPE')) \
        .reset_index(drop=True)
    return surveyCodeQuery


def form_mosaic(x):
    """to concatenate mosaic habitats """
    eunis_dict = {}
    for col in x:
        if col == 'Eunis_L3':
            eunis_dict[col] = '+'.join
        elif col == 'HAB_TYPE':
            eunis_dict[col] = '+'.join
        else:
            eunis_dict[col] = 'first'
    mosaic = x.groupby(by='POLYGON', as_index=False).aggregate(eunis_dict)
    return mosaic


def explode_multipart_polygons(input_data_source):
    """
    This Function uses geopandas to check for MultiPolygon with the input_shapefile and if any are found they are
    exploded.

    :param input_data_source: Path to shapefile to check and explode.
    :return:
    """

    # Find unique geometry types
    geometry_types = input_data_source['geometry'].geom_type.unique()

    # if MultiPolygon are in geometry_types these are exploded using geopandas.GeoDataFrame.explode
    if 'MultiPolygon' in geometry_types:
        print('Data Set has MultiPolygon - Exploding {}'.format(input_data_source))
        exploded = input_data_source.explode()
        exploded_geometry_types = exploded['geometry'].geom_type.unique()

        # Quick self QC is any MultiPolygon remain
        if 'MultiPolygon' in exploded_geometry_types:
            print('Data Set still has MultiPolygon')
        else:
            print('No MultiPolygon')
            return exploded
    else:
        print('No MultiPolygon- No Exploding {}'.format(input_data_source))
        return input_data_source


def check_geometry(input_data_source):
    """
    This Function uses geopandas to check if the input_shapefile geometry is valid,
    and will fix basic self intersection issues

    :param input_data_source: Path to shapefile to validated
    :return:
    """
    ids = input_data_source

    # Find unique geometry types
    geometry_valid = ids['geometry'].is_valid.unique()
    # Check all geometry is valid.
    ids['geometry_valid'] = ids['geometry'].is_valid
    # If any geometries fail, return False, geometry is buffered by 0 to eliminate self intersection
    if False in geometry_valid:
        print('geometry is Invalid, Repairing')
        ids['geometry_valid'] = ids['geometry'].is_valid
        ids.loc[ids.geometry_valid == False, 'geometry'] = ids['geometry'].buffer(0)
    else:
        print('Geometry is Valid')
    return ids


